import React, { Component } from "react";
import { Form } from "react-bootstrap";

class VideoCap extends Component {
  state = {};
  render() {
    return (
      <div>
        <Form>
          <Form.Group
            className="mb-3"
            controlId={"Form.Question" + this.props.current_question.toString()}
          >
            <Form.Label>
              {this.displayContext()}
              {this.props.config["question"]}
            </Form.Label>
            <Form.Control
              as="textarea"
              rows={3}
              onChange={this.update_answers}
            />
          </Form.Group>
        </Form>
      </div>
    );
  }
}

export default VideoCap;
